import React from 'react';

class NavMenu extends React.Component {

    render() {
        return (
            <div className="ui container">
                <div classname="ui three item menu">
                    <p className="active item">Home</p>
                    <p className="item">Next</p>
                </div>
            </div>
        )
    }
}

export default NavMenu;
